import React, { useParams } from 'react';
import { useNavigate } from 'react-router-dom';

function TitleSearch() {
  const navigate = useNavigate();
  const { url } = useParams();

  useEffect(() => {
    window.location.href = url;
  }, [url]);

  return (
    <div>
    </div>
  );
}

export default TitleSearch;
